response.about:
– Зачем живёшь на свете ты?
И мой ответ таков:
– Чтоб розы дивной красоты
Найти средь сорняков;
Чтоб ошибаться и прощать
Нападки злой молвы;
Средь пены облаков искать
Осколок синевы;
Чтоб нежно целовать уста
Того, кто сердцу мил;
Чтоб рассказать, как жизнь чиста,
Тем, кто о том забыл...
Александр Аносов
